script: |
  super -f text -I q2964.spq | sort > q2964.out

inputs:
  - name: q2964.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 BETWEEN + + col2 / + - CAST ( NULL AS REAL ) + - - 51 AND + 70;
  - name: tab0

outputs:
  - name: q2964.out
    data: |
      -2
